enum{STAND, STANDL, RUN, RUNL, JUMP, JUMPL, JUMPR, MELEE, MELEEL, PROJ, PROJL, DEAD}; //Player actions
enum{NULL, LNULL, SHOOT, SHOOTL};	//projectile actions
enum{PIKACHU, LUCARIO};
// Struct declarations of different characters
player_t Player[2] = {
	{PIKACHU, stand1x, STAND, 0, 104, 34, 31, 100, 1, thunder0, NULL, 2, 0, 1, 1, 15},
	{LUCARIO, standing2, STAND, 0, 104, 42, 49, 100, 1, thunder0, NULL, 2, 0, 1, 1, 15}
};
player_t Enemy[2] = {
	{PIKACHU, lstand1, STANDL, 124, 104, 34, 31, 100, 1, thunder0, NULL, 2, 0, 1, 1, 15},
	{LUCARIO, lstanding2, STANDL, 124, 104, 42, 49, 100, 1, thunder0, NULL, 2, 0, 1, 1, 15}
};
void DoNothing(void);
uint8_t col;
uint8_t screen;
enum{TITLE, CHARSEL, READY, FIGHT, RESULT};
uint8_t disp1 = 0;
uint8_t disp2 = 0;
uint8_t P1;
uint8_t P2;
uint8_t numPlays = 0;
uint8_t p1wins = 0;
uint8_t p2wins = 0;
uint8_t power = 0;
uint8_t plusAtt = 0;
uint8_t plusSpa = 0;
extern uint32_t Index;
extern uint32_t counter;
uint8_t songreset = 0;
uint16_t random2;
int main(void){
  TExaS_Init();  // set system clock to 80 MHz
	//Sound_Init(7256);
  Output_Init();
	PortE_Init();
	ADC_Init();
  ST7735_SetRotation(1);
	player_t ppBack = Player[0];
	player_t lpBack = Player[1];	
	player_t peBack = Enemy[0];
	player_t leBack = Enemy[1];
	screen = TITLE;
	//screen = RESULT;
	//p2wins = 2;
	//p1wins = 1;
	//uint8_t sent = 0;
	uint32_t seed;
	while(1){
		while(screen == TITLE){
			//Sound_Init(14512);
			//Sound_Open();
			EnableInterrupts();
			uint16_t black = ST7735_Color565(0, 0, 0);
			uint16_t grey = ST7735_Color565(150, 150, 150);
			char prompt1[17]={'P', 'r', 'e', 's', 's', ' ', 'a', 'n', 'y', ' ', 'b', 'u', 't', 't', 'o', 'n', 0x00};
			ST7735_FillScreen(0xEEF8);
			ST7735_DrawBitmap(56, 100, &pokeball[0], 48, 48);//ST7735_DrawBitmap(59, 52, const &pokeball[0], 48, 48)
			ST7735_DrawChar(25, 30, 0x50, black, 0xEEF8, 2);//P, adjust 9 so that POKKEN 2D appears in middle of screen, subsequent x values should be increased by 12, 30 should be 24 for all drawchars
			ST7735_DrawChar(37, 30, 0x4F, black, 0xEEF8, 2);//O,
			ST7735_DrawChar(49, 30, 0x4B, black, 0xEEF8, 2);//K, 
			ST7735_DrawChar(61, 30, 0x4B, black, 0xEEF8, 2);//K,
			ST7735_DrawChar(73, 30, 0x45, black, 0xEEF8, 2);//E, 
			ST7735_DrawChar(85, 30, 0x4E, black, 0xEEF8, 2);//N
	
			ST7735_DrawChar(109, 30, 0x32, black, 0xEEF8, 2);//2, 93 should be previous drawchar's x value plus 24 
			ST7735_DrawChar(121, 30, 0x44, black, 0xEEF8, 2);//D
			//Initialize Characters and Variables
			numPlays = 0;
			p1wins = 0;
			p2wins = 0;
			power = 0;
			plusAtt = 0;
			plusSpa = 0;
			songreset = 0;
			
			while(GPIO_PORTE_DATA_R==0){
				ST7735_DrawString(5, 11, &prompt1[0], black);
				Delay100ms(4);
				ST7735_FillRect(0, 100, 160, 28, 0xEEF8);//120 should be 96, 128 should be 160, 40 should be 32
				Delay100ms(3);
			}
			Sound_Init(7256); //11.025KHz
			Sound_Select();
			seed = NVIC_ST_CURRENT_R;
			Random_Init(seed);
			screen = CHARSEL;
		}
		while(screen == CHARSEL){
			Delay100ms(5);
			P1 = CharSelect();
			random2 = Random();
			if(random2 >= 128)
				P2 = PIKACHU;
			else
				P2 = LUCARIO;
			Delay100ms(2);
			screen = READY;
		}
		
		if(screen == READY){
			Timer0_Init(&DoNothing, 2000000);		//interrupt value of 40Hz
			Timer1_Init(&DoNothing, 2000000);;
			if(Player[P1].poke == PIKACHU)
				Player[P1] = ppBack;
			else if(Player[P1].poke == LUCARIO)
				Player[P1] = lpBack;
			if(Enemy[P2].poke == PIKACHU)
				Enemy[P2] = peBack;
			else if(Enemy[P2].poke == LUCARIO)
				Enemy[P2] = leBack;
			Player[P1].dmg += plusAtt;
			Player[P1].pdmg += plusSpa;
			char readystring[]={'R', 'O', 'U', 'N', 'D', ' ', (numPlays + 1 + 0x30),0x00};
			char fightstring[] = {'F', 'I', 'G', 'H', 'T', '!', 0x00};
			ST7735_FillScreen(0xEEF8);
			ST7735_FillScreen(0xEEF8);
			ST7735_FillScreen(0xEEF8);
			ST7735_DrawBitmap(0, 27, sky, 160,28);
			ST7735_DrawBitmap(0, 127, ground, 160,23);
			//ST7735_DrawBitmap(Player[P1].x, Player[P1].y, Player[P1].image, Player[P1].w, Player[P1].h);
			//ST7735_DrawBitmap(Enemy[P2].px, Enemy[P2].py, Enemy[P2].pImage, Enemy[P2].pw, Enemy[P2].ph);
			ST7735_DrawString(10, 5, &readystring[0], 0x0000);
			Delay100ms(7);
			ST7735_FillRect(0, 27, 159, 77, 0xEEF8);
			ST7735_DrawString(111, 5, &fightstring[0], 0x0000);
			Delay100ms(3);
			ST7735_FillRect(0, 27, 159, 77, 0xEEF8);
			screen = FIGHT;
			numPlays++;
			Timer0_Init(&Player_Update, 2000000);		//interrupt value of 40Hz
			Timer1_Init(&Enemy_Update, 2000000);
		}
		
		while(screen == FIGHT){
			if(songreset == 0){
				Sound_Init(14512);
				Sound_Battle1();
				songreset++;
			}
			while((disp1 == 0)&&(disp2 == 0));
			if(Player[P1].poke == PIKACHU)
				ST7735_FillRect(Player[P1].x, Player[P1].y-(3*Player[P1].h/2), Player[P1].w, (Player[P1].h/2), 0xEEF8);
			if(Enemy[P2].poke == PIKACHU){
				ST7735_FillRect(Enemy[P2].x, Enemy[P2].y-(3*Enemy[P2].h/2), Enemy[P2].w, (Enemy[P2].h/2), 0xEEF8);
				ST7735_FillRect(Enemy[P2].x+Enemy[P2].w, Enemy[P2].y-(Enemy[P2].h), 6, (Enemy[P2].h), 0xEEF8);
			}
			if(Player[P1].x <= 0)
				Player[P1].x = 0;
			if(Enemy[P2].x < 5)
				Enemy[P2].x = 5;
			if(disp1){
				disp1 = 0;
				ST7735_DrawBitmap(Player[P1].x, Player[P1].y, Player[P1].image, Player[P1].w, Player[P1].h);			//display player sprite
				ST7735_DrawBitmap(Player[P1].px, Player[P1].py, Player[P1].pImage, Player[P1].pw, Player[P1].ph);	//display player projectile sprite
			}
			if(disp2){
				disp2 = 0;
				ST7735_DrawBitmap(Enemy[P2].x, Enemy[P2].y, Enemy[P2].image, Enemy[P2].w, Enemy[P2].h);						//display enemy sprite
				ST7735_DrawBitmap(Enemy[P2].px, Enemy[P2].py, Enemy[P2].pImage, Enemy[P2].pw, Enemy[P2].ph);	//display enemy projectile sprite
			}
			ST7735_SetCursor(0,0);
			ST7735_OutUDec(Enemy[P2].hp);
			DetectCollision(Player[P1], Enemy[P2]);
			DrawHP();
			if(Player[P1].hp == 0){
				p2wins++;
				if(((p1wins + p2wins) == 3)||((p1wins == 2)&&(numPlays == 2))||((p2wins == 2)&&(numPlays == 2))){
					Sound_Stop();
					screen = RESULT;
				}
				else{
					Delay100ms(4);
					Timer0_Init(&DoNothing, 2000000);		//interrupt value of 40Hz
					Timer1_Init(&DoNothing, 2000000);
					ST7735_FillRect(0, 28, 160, 77, 0xEEF8);
					power = TestLuck();
					Delay100ms(10);
					plusAtt += (power&0x0F);
					plusSpa += ((power&0xF0)>>4);
					Delay100ms(10);
					screen = READY;
				}
			}
			else if(Enemy[P2].hp == 0){
				p1wins++;
				if(((p1wins + p2wins) == 3)||((p1wins == 2)&&(numPlays == 2))||((p2wins == 2)&&(numPlays == 2))){
					Sound_Stop();
					screen = RESULT;
				}
				else{
					Delay100ms(4);
					Timer0_Init(&DoNothing, 2000000);		//interrupt value of 40Hz
					Timer1_Init(&DoNothing, 2000000);
					ST7735_FillRect(0, 28, 160, 77, 0xEEF8);
					power = TestLuck();
					Delay100ms(10);
					Delay100ms(10);
					screen = READY;
				}
			}
		}
		if(screen == RESULT){
			Timer0_Init(&DoNothing, 2000000);		//interrupt value of 40Hz
			Timer1_Init(&DoNothing, 2000000);
			ST7735_FillScreen(0x0000);
			Delay100ms(2);
			screen = DisplayResults(p1wins, p2wins);
			Delay100ms(5);
		}
	}
}

void DoNothing(void){
}

// You can use this timer only if you learn how it works
void Delay100ms(uint32_t count){uint32_t volatile time;
  while(count>0){
    time = 727240;  // 0.1sec at 80 MHz
    while(time){
	  	time--;
    }
    count--;
  }
}
